import React from 'react';
import {Route} from 'react-router-dom';
import Login from './Components/login';
import Home from './Components/home';
import './App.css';

function App() {
  return (
    <div>
      <Route path='/' Component={Login}/>
      <Route path='/home' Component={Home}/>
    </div>
  );
}

export default App;
